reportToolbar.customizedReportConfig:
context {
  id: "advertising-adwords-sitelinks"
  title {
    value: "Sitelinks"
    is_message_id: false
  }
  help_topic_id: 1043504
  context_metric: "analytics.totalVisitors"
  dimension_filter {
    dimension: "analytics.source"
    expression: "google"
  }
  dimension_filter {
    dimension: "analytics.trafficType"
    expression: "paid"
  }
  dimension_filter {
    dimension: "analytics.adwordsCampaignID"
    expression: "(not set)"
    match_type: EXACT
    complement: true
  }
  is_custom: true
}
